import React from "react";
import styled from "styled-components";
import pfp_default from "../img/pfp_default.png";
import thumbnail_default from "../img/thumbnail_default.jpg";

const Container = styled.div`
  width: 4000px;
  margin-bottom: 45px;
  cursor: pointer;

`;

const Details = styled.div`
  display: flex;
  margin-top:16px;
  gap: 12px;
`;

const ChannelImage = styled.img`
  width: 36px;
  height: 36px;
  border-radius: 50%;
`;

const Image = styled.img`
  height: 100%;
  height: 202px;
  background-color: #999;
`;


const Card = () => {
  return <Container><Image src={thumbnail_default}/>
  <Details><ChannelImage src={pfp_default}/></Details>
  </Container>;
};

export default Card;
